import React from "react";


const products = [
    { id: 1, name: "Sports Car", price: 250, image: "data:image/jpeg;base64," },
    { id: 2, name: "Luxury SUV", price: 300, image: "data:image/jpeg;base64," },
    { id: 3, name: "Electric Vehicle", price: 280, image: "data:image/jpeg;base64," },
    { id: 4, name: "Classic Muscle Car", price: 320, image: "data:image/jpeg;base64," },
    { id: 5, name: "Convertible", price: 270, image: "data:image/jpeg;base64," },
    { id: 6, name: "Racing Car", price: 350, image: "data:image/jpeg;base64," }
  ];

const Cards = () => {
  return (
    <div className="cards-container">
      {products.map((item) => (
        <div key={item.id} className="card">
          <img src={item.image} alt={item.name} />
          <div className="card-content">
            <h2>{item.name}</h2>
            <p>${item.price}</p>
          </div>
        </div>
      ))}
    </div>
  );
};

export default Cards;



